import { createTheme } from '@mui/material/styles';

export const purpleTheme = createTheme({
  palette: {
    mode: 'dark',
    primary: { main: '#6c47b5ff' },
    background: { default: '#1A1625', paper: '#2D2438' },
    text: { primary: '#E9D8FD', secondary: '#B794F4' },
    success: { main: '#68D391' },
  },
});
